        this.Phone = data.mobileNo;
        this.email = data.email;
        this.balance = data.balance;
        this.amount = data.amount;
        this.tellerNo = data.referenceId;
        this.date = data.paymentDate;
        this.userId = data.userId;
        this.reqId = data.id;
